import * as fgui from "panorama-fgui-types/fgui/FairyGUI";
import { BaseView } from "../BaseView";

export const __bag_Data : string = "";

export class bag_bagview_data extends BaseView{
	public show_c : fgui.Controller;
	public n13 : fgui.GImage;
	public n14 : fgui.GImage;
	public item_head : fgui.GButton;
	public item_foot1 : fgui.GButton;
	public item_jaw : fgui.GButton;
	public item_foot2 : fgui.GButton;
	public item_hand2 : fgui.GButton;
	public item_hand1 : fgui.GButton;
	public model : fgui.GDOTAScenePanel;
	public itemList : fgui.GList;
	public closeBtn : fgui.GComponent;
	public show_t : fgui.Transition;
	public close_t : fgui.Transition;
    constructor()
    {
        super();
        this.package = "bag";
        this.packageItem = "bagview";
        this.binData = __bag_Data;

        this.OnInit();
    }

    public OnInit():void
    {
        super.OnInit();
		this.show_c = this.getController("show");
		this.n13 = <fgui.GImage><unknown>(this.getChild("n13"));
		this.n14 = <fgui.GImage><unknown>(this.getChild("n14"));
		this.item_head = <fgui.GButton><unknown>(this.getChild("item_head"));
		this.item_foot1 = <fgui.GButton><unknown>(this.getChild("item_foot1"));
		this.item_jaw = <fgui.GButton><unknown>(this.getChild("item_jaw"));
		this.item_foot2 = <fgui.GButton><unknown>(this.getChild("item_foot2"));
		this.item_hand2 = <fgui.GButton><unknown>(this.getChild("item_hand2"));
		this.item_hand1 = <fgui.GButton><unknown>(this.getChild("item_hand1"));
		this.model = <fgui.GDOTAScenePanel><unknown>(this.getChild("model"));
		this.itemList = <fgui.GList><unknown>(this.getChild("itemList"));
		this.closeBtn = <fgui.GComponent><unknown>(this.getChild("closeBtn"));
		this.show_t = this.getTransition("show");
		this.close_t = this.getTransition("close");
    }
}

